import React from "react";

import "./Button.css";

interface ButtonProps {
  styles: string;
  children: React.ReactNode;
  type?: string;
  onClick: () => void;
}

const Button: React.FC<ButtonProps> = function ({ styles, onClick, type }) {
  return (
    <button
      className={styles}
      type={(type = null || "submit")}
      onClick={onClick}
    >
      <span className="material-icons"></span>
    </button>
  );
};

export default Button;
